import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';
import Stack from 'react-bootstrap/Stack';
import Button from 'react-bootstrap/Button';
import { textAlign } from '@mui/system';

const ReviewCard = () => {
  return (
    
    <Container>
        <Row>
            <Stack direction="horizontal" gap={3} className ='m-2'>
                <div className=""> 
                    <h2>Reviews</h2>
                    <p>See star ratings and reviews left by clintes after their visit . Learn More</p>
                </div>
            </Stack>
            <Card style={{ width: '71rem' }} cl >
            
                    <Card.Body>
            
                       <Button variant="outline-secondary">Filters </Button>
                        
                    </Card.Body>
            </Card>
             <Card style={{ width: '71rem', textAlign: 'center'}}>
                 <h2>Reviews</h2>
             
             </Card>
        </Row>
    
    </Container>
  )
}

export default ReviewCard
